import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input
} from "antd";
import Link from "next/link";
import HeaderCovid from "./components/component.headercovid";

const FormItem = Form.Item;

function CovidPage3() {
  return (
    <div style={{ marginTop: 0 }}>
      <FormItem>
        <div className="nu-font-covid">
          <div>
            Picture
            <form>
              <h3 style={{ color: "white" }}>ชื่อ สกุล</h3>
              <Input
                placeholder="ชื่อ สกุล"
                type="text"
                value={Name}
                onChange={(e) => updateName(e.target.value)}
              />
              <h3 style={{ color: "white" }}>หมายเลขประจำตัวประชาชน</h3>
              <Input
                placeholder="หมายเลขประจำตัวประชาชน"
                type="text"
                value={SSID}
                onChange={(e) => updateSSID(e.target.value)}
                required
              />
              <h3 style={{ color: "white" }}>วัน เดือน ปีเกิด</h3>
              <DatePicker
                style={{
                  width: "100%",
                  justifyContent: "flex-end",
                  alignItems: "flex-end",
                  display: "flex",
                }}
                onChange={handleChange}
                required
              />
              <h3 style={{ color: "white" }}>รหัสไปรษณีย์</h3>
              <Input
                placeholder="รหัสไปรษณีย์"
                type="text"
                value={PostId}
                onChange={(e) => updatePostId(e.target.value)}
                required
              />
            </form>
          </div>
        </div>
      </FormItem>
    </div>
  );
}

export default CovidPage3;
